function createDevice(deviceType, id){
    var device = determineKind(id);

    return {
        id: id,
        name: device.name,
        type: deviceType,
        image: device.image,
        sokVersion: 0.1,
        description: device.name + ' is een geweldige ' + deviceType + ' die bijvoorbeeld het commando ' + device.commands.status.name + ' kan uitvoeren!',
        commands: device.commands
    };
}

